import React from 'react';

class Block extends React.Component {
  render() {
    return (

      <div className="blank-area myPar">
        <h1 className="tracking-in-contract">
          <i className="fa fa-heart-o" ></i>
          Lovely Bites
      <i className="fa fa-heart-o" ></i>
        </h1>
        <p>After thirteen years of searching, we found the secret to make the most tasty cakes you have ever taste.</p>

        <p><a href="team-error.com" target="_blank">This template is done by <span className="team-error">team error</span></a></p>
        <p>
          <i className="fa fa-heart-o" ></i>
          <i className="fa fa-heart-o" ></i>
          <i className="fa fa-heart-o" ></i>
          With Love
          <i className="fa fa-heart-o" ></i>
          <i className="fa fa-heart-o" ></i>
          <i className="fa fa-heart-o" ></i>
        </p>
      </div>

    )
  }
}

export default Block;
